import React, { useState, useEffect } from 'react';
import socket from './socket';

function Chat() {
  const [username, setUsername] = useState('');
  const [room, setRoom] = useState('');
  const [isJoined, setIsJoined] = useState(false);
  const [message, setMessage] = useState('');
  const [messages, setMessages] = useState({});
  const [activeRooms, setActiveRooms] = useState([]);
  const [participants, setParticipants] = useState([]);

  const joinRoom = () => {
    if (username.trim() && room.trim()) {
      socket.emit('join_room', { room, username });
      setIsJoined(true);
    }
  };

  const sendMessage = () => {
    if (message.trim()) {
      const msgData = { sender: username, room, message };
      socket.emit('send_message', msgData);
      setMessages((prev) => {
        const roomMessages = prev[room] || [];
        return {
          ...prev,
          [room]: [...roomMessages, { sender: username, message }],
        };
      });
      setMessage('');
    }
  };

  useEffect(() => {
    socket.on('receive_message', (data) => {
      const { room: msgRoom, sender, message } = data;
      setMessages((prev) => {
        const roomMessages = prev[msgRoom] || [];
        return {
          ...prev,
          [msgRoom]: [...roomMessages, { sender, message }],
        };
      });
    });

    socket.on('room_list', (rooms) => {
      setActiveRooms(rooms);
    });

    socket.on('user_list', (userList) => {
      setParticipants(userList);
    });

    return () => {
      socket.off('receive_message');
      socket.off('room_list');
      socket.off('user_list');
    };
  }, []);

  // Fetch initial room list
  useEffect(() => {
    socket.emit('get_rooms');
  }, []);

  if (!isJoined) {
    return (
      <div>
        <h2>Join a Chat Room</h2>
        <input
          placeholder="Your Name"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
        <input
          placeholder="Room Name"
          value={room}
          onChange={(e) => setRoom(e.target.value)}
        />
        <button onClick={joinRoom}>Join</button>

        {activeRooms.length > 0 && (
          <div style={{ marginTop: '20px' }}>
            <h4>Active Rooms:</h4>
            <ul>
              {activeRooms.map((r, idx) => (
                <li key={idx}>{r}</li>
              ))}
            </ul>
          </div>
        )}
      </div>
    );
  }

  return (
    <div>
      <h2>Room: {room} | You: {username}</h2>

      <div style={{ marginBottom: '10px' }}>
        <strong>Participants:</strong> {participants.join(', ')}
      </div>

      <div style={{ height: '300px', overflowY: 'auto', border: '1px solid #ccc', padding: '10px', marginBottom: '20px' }}>
        {(messages[room] || []).map((msg, idx) => (
          <div
            key={idx}
            style={{
              background: msg.sender === username ? '#d1e7dd' : '#f8d7da',
              padding: '8px',
              borderRadius: '8px',
              marginBottom: '5px',
              maxWidth: '60%',
              alignSelf: msg.sender === username ? 'flex-end' : 'flex-start',
            }}
          >
            <strong>{msg.sender}:</strong> {msg.message}
          </div>
        ))}
      </div>

      <div style={{ display: 'flex', gap: '10px' }}>
        <input
          style={{ flex: 1 }}
          value={message}
          onChange={(e) => setMessage(e.target.value)}
          placeholder="Type a message..."
        />
        <button onClick={sendMessage}>Send</button>
      </div>
    </div>
  );
}

export default Chat;
